import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SeatService {

  constructor() { }
  private seatData: any = {};

  setSeatData(data: any) {
    this.seatData = data;
  }

  getSeatData() {
    return this.seatData;
  }
}
